import React from "../../../node_modules/react/../node_modules/react";
import "./Footer.css";

const Footer = () => (
	<footer className="footer">
		<div className="footer-bottom">
			Clicky Game! 
			<img alt="react" src="assets/images/react.svg"/>
		</div>
	</footer>

);

export default Footer;
